          <div className="timeline">
            <div className="row">
              <div className="timeline-item">
                <div className="timeline-item-inner outer-shadow">
                  <i className="fas fa-briefcase icon"></i>
                  <span>September, 2019 - Present</span>
                  <h3>Backend Engineer</h3>
